import React from "react";
import "./styles.scss";

const menuItems = [
  { name: "Home", link: "#landing" },
  { name: "About", link: "#about" },
  { name: "Work", link: "#work" },
];

const MenuList = (props) => {
  return (
    <div className="menulist">
      <ul>
        {menuItems.map(({name, link}) => (
          <li> {item}</li>
        ))}
      </ul>
    </div>
  );
};

export default MenuList;
